torpedos.SetMaxCondition(200.000000)
torpedos.SetCritical(0)
torpedos.SetTargetable(0)
torpedos.SetPrimary(1)
torpedos.SetPosition(0.000000, 0.000000, 0.000000)
torpedos.SetPosition2D(0.000000, 0.000000)
torpedos.SetRepairComplexity(1.000000)
torpedos.SetDisabledPercentage(0.500000)
torpedos.SetRadius(0.250000)
torpedos.SetNormalPowerPerSecond(1.000000)
torpedos.SetWeaponSystemType(torpedos.WST_TORPEDO)
torpedos.SetSingleFire(1)
torpedos.SetAimedWeapon(0)
kFiringChainString = App.TGString()
kFiringChainString.SetString("")
torpedos.SetFiringChainString(kFiringChainString)
App.g_kModelPropertyManager.RegisterLocalTemplate(torpedos)

